INSERT INTO `product` VALUES (1,'0;42ecd5b2-c515-11e5-aec9-b6fb3f5b2329','Барвник Абрикосовий смесевой','barvnik_abrikosovii_smesevoi','Артикул не задан','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,5-1,1 кг/т'),(2,'0;b0c25899-9aac-11e4-a570-2e85dff2b333','Емульсія Абрикос','emulsiya_abrikos','ТОВ \"ВМ Про\"','Эмульсия используется в производстве напитков. Наша компания имеет широкий ассортимент образцов готовых напитков на сахаре и сахарозаменителях. Предоставляем рецептуры. Заказывайте напиток и производите его вместе с нами. \nДозировка указана в рецептуре, примерно  0,5-1кг на 1000л напитка.\nТак же ароматизатор применяется во все пищевые продукты, в жидкость для электронных сигарет (обратите внимание, многие позиции для напитков могут быть окрашены)\nУпаковка канистра 10кг, бутылка пластиковая 1кг, флакон 30г, бутылочка 10г и флакон 1г.'),(3,'0;a41577d3-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка	0,800 - 1,200 кг на 1т готового продукта.'),(4,'0;b7a1e00a-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"УкрАрома\"','Інгредієнт відповідає назві за смаком і ароматом. Термостійкий. Дозування підбирається індивідуально для продукту, приблизно 0,8 - 1,2 кг на 1 тонну готового продукту.\nЗастосовується в кондитерській промисловості, у виробництві фруктових наповнювачах і начинках, морозиві, напоях та інших харчових продуктах, а також в підгодівлю для річкової риби.\nУпаковка каністра 10кг, пляшка пластикова 1кг, флакон 30г, пляшечка 10г і флакон 1г'),(5,'0;b6777352-2188-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(6,'0;42852bb3-2be1-11e6-ad16-cab4f2128b62','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"УкрАрома\"','Ингредиент соответствует названию по вкусу и аромату. Термостойкий. Дозировка подбирается индивидуально для продукта примерно  0,8  - 1,2кг на 1 тонну готового продукта.\nПрименяется в кондитерской промышленности, в производстве фруктовых наполнителях и начинках, мороженом, напитках и других пищевых продуктах, а также в прикормку для речной рыбы, в жидкость для электронных сигарет.\nУпаковка канистра 10кг, бутылка пластиковая 1кг, флакон 30г, бутылочка 10г и флакон 1г\nПредставлен в жидкой и порошкообразной форме. Выбирете характеристику. Порошкообразные ароматизаторы применяются в продуктах, в которых нет возможности налить жидкость. Такие как сухие кисели, каши быстрого приготовления, желе для домашнего пользования и прочие продукты'),(7,'0;df8fe076-e067-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"УкрАрома\"','Нет описания'),(8,'0;a41577d7-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка	0,800 - 1,200 кг на 1т готового продукта.'),(9,'0;a41576e4-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Абрикос','aromatizator_harchovii_abrikos','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в  у производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\nДозировка для каши  0,07-0,14% к готовому продукту.\nПредельно допустимая дозировка не более 14 % к готовому продукту'),(10,'0;cad6113a-9aac-11e4-a570-2e85dff2b333','Барвник Абрикосовий суміш','barvnik_abrikosovii_sumish','ТОВ \"Компанія Лев-Украіна\"','Використовують для фарбування тесту, мастики, і багатьох харчових продуктів. Для яскравого фарбування білкового крему використовуйте порошкоподібні барвники.\nФасування 25кг, 1кг, 100г, 10г\n(Барвник у рідкій формі та порошкоподібний, в залежності від характеристикі.\nДозування для гелеобразій рідени - 20-50грамм/100кг готового продукту\n                         для порошка 2-5 грамм /100кг готового продукту'),(11,'0;d10eb2f0-9aac-11e4-a570-2e85dff2b333','Агар-агар Food Gum Е-406','agar-agar_food_gum_e-406','Foodchem International Corporation','Е 406. (гелеобразователь, загуститель, стабилизатор, влагоудерживающий агент, плёнкообразователь, осветлитель, средство для капсулирования) .  Рекомендуется для зефиров. Пищевой агар является стабилизатором, улучшающим структуру и консистенцию мороженого, и используется как желатин, образуя крепкие студни в водных растворах, причем желирующая способность агара выше желирующей способности желатина.\nДозировка: 900грамм на 100кг готового продукта.   Варится сахаро-агарово-паточный сироп 70-80кг (в нем агара примерно  900грамм) , уваривается до 78% сухих. Затем этот сироп добавляется  в взбитый белок или другую смесь, в зависимости от продукта. соотошение воды и агара 1:20\nРекомендуемые дозировки, г/кг:\nМармелад………………………….8-12\nПат…………………………………5-8\nДжемы……………………………..5-8\nЗефиры…………………………….6-8\nПастила……………………………6-9\nПтичье молоко, суфле……………6-8\nМороженое………………………..1-3\nтворожеренная масса - 1г/кг\nКондитерские изделия, желе……10-20\nГлазури, покрытия……………….10-30\nМайонезы…………………………5-10\nСыр………………………………...8\nХлебобулочные изделия\n(для замедления черствения)…….1-10\nДля осветления напитков………...0,5-1,5\n\nДозировка зависит от вида агара и показателя «Прочность студня».'),(12,'0;d10eb2f8-9aac-11e4-a570-2e85dff2b333','Агар-Агар GB1975','agar-agar_gb1975','Putian Han Soar Trading Co.,LTD','1200г/см2.   Е 406. (гелеобразователь, загуститель, стабилизатор, влагоудерживающий агент, плёнкообразователь, осветлитель, средство для капсулирования) .  Рекомендуется для зефиров. Пищевой агар является стабилизатором, улучшающим структуру и консистенцию мороженого, и используется как желатин, образуя крепкие студни в водных растворах, причем желирующая способность агара выше желирующей способности желатина.\nДозировка: 900грамм на 100кг готового продукта.   Варится сахаро-агарово-паточный сироп 70-80кг (вначале полностью растворить агара! примерно  900грамм) , уваривается до 78% сухих. Затем этот сироп добавляется  в взбитый белок или другую смесь, в зависимости от продукта. соотошение воды и агара 1:20\nРекомендуемые дозировки, г/кг:\nМармелад………………………….8-12\nПат…………………………………5-8\nДжемы……………………………..5-8\nЗефиры…………………………….6-8\nПастила……………………………6-9\nПтичье молоко, суфле……………6-8\nМороженое………………………..1-3\nКондитерские изделия, желе……10-20\nГлазури, покрытия……………….10-30\nМайонезы…………………………5-10\nСыр………………………………...8\nХлебобулочные изделия\n(для замедления черствения)…….1-10\nДля осветления напитков………...0,5-1,5\n\nДозировка зависит от вида агара и показателя «Прочность студня».'),(13,'0;9a3a3828-27e3-11e6-ad16-cab4f2128b62','Альбумин','albumin','Dalian Hanovo Foods Co., LTD','Сухой яичный белок – продукт, полученный из свежих яиц путём отделения желтков с последующей фильтрацией и термической обработкой. После чего его сушат и пастеризуют. Альбумин - незаменимый ингредиент для меренг, айсинга, декора тортов. От жидкого яичного белка он отличается повышенной взбиваемостью и стабильностью результата. Ягодные меренги, например, никогда не взобьются в стойкую массу без альбумина.\nКоэффициенты замены для яиц со средней массой 50 г:\nАльбумин 1кг = 316 белков свежих яиц\nАльбумин 100 г белка в порошке + 900 г воды = 1 кг жидкого белка\nВода, используемая для гидратации порошков должна иметь комнатную температуру.\nИспользуется в кондитерском производстве - безе, суфле, меренги, зефир, пастила, бисквиты, муссы, белковые пирожные, крема, торты, кондитерские изделия требующие воздушности и др., спортивном питании, диетическом питании (для приготовления низкокаллорийной выпечки) и коктейлей.\nСпособ использования(бисквиты, белковые пирожные):\n- в посуду заливается вода температурой 30-35 С, в соответствии с пропорцией для восстановления - 1 часть сухого яичного белка на 8 частей воды (минимум 6). На 1 литр воды  - 120гр. белка.\nСначала вливают немного воды (30 гр), тщательно перемешивают, продолжая размешивать, вливают остальную воду. Смесь перемешивать в течении 20 - 30 сек. И оставить для полного растворения на 30-40 минут. Восстановленные белки взбивают поэтапно: сначала на малой скорости (2-3 минуты до появления белой пены), а затем на большой до увеличения объема и добавляют к взбитым белкам около 15 % кол-ва сахарной пудры, или сахарозаменителя, предусмотренного рецептурой, после взбивания 7-10 минут вводят остальное кол-во сахарной пудры. 1 литр готовой смеси (белок-вода) = 31 яичному белку.\nВ 1 чайной ложке альбумина - 4 грамма\nВ 1 столовой ложке альбумина - 14 граммов.'),(14,'0;cad61049-9aac-11e4-a570-2e85dff2b333','Барвник Алюра червоний','barvnik_alyura_chervonii','MASCOT FOOD COLOURS','Allura Red AC, красный очаровательный, применяется для окрашивания кондитерских изделий, и других пищевых продуктов. Белковый крем рекомендуем окрашивать порошком. Мастику - жидким алюровым\nФасовка 25кг, 1кг, 100г для порошков. 1кг и 100г для жидкой формы.\nДозировка для порошка 2-5г / 100кг продукта\n                 для жидкости 50г/100кг продукта'),(15,'0;a41577db-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Амаретто','aromatizator_harchovii_amaretto','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка	0,800 - 1,200 кг на 1т готового продукта.'),(16,'0;a41577df