трактанти, корм для тварин і т.п.\nДозування 0,7- 1 кг / 1т готового продукту\nФасовка 9кг, 1 кг, 30г, 1г.'),(25,'0;1786c868-6dc0-11e6-971d-cab4f2128b62','Ароматизатор харчовий Аніс','aromatizator_harchovii_anis','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т.ВИКОРИСТОВУЄТЬСЯ В ЕЛЕКТРОННИХ ЦИГАРКАХ.'),(26,'0;9dc276ce-e068-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Аніс','aromatizator_harchovii_anis','ТОВ \"УкрАрома\"','Нет описания'),(27,'0;cad61081-9aac-11e4-a570-2e85dff2b333','Барвник Аннато порошок','barvnik_annato_poroshok','Naturex Ltd','Е 160 b. Концентрация пигментов: 15% норбиксина. Термостабильность, светостойкость- хорошая. Применение: мороженое, сыр, глазури, пирожные/печенья, копчёности. Оттенок: жёлтый, оранжевый. Рекомендации по дозировке: 0,005-0,1%.'),(28,'0;cad61085-9aac-11e4-a570-2e85dff2b333','Барвник Аннато екстракт','barvnik_annato_ekstrakt','Naturex Ltd','Е 160 b. Концентрація пігментів: 2,65% норбіксіна.   Аннато, або бікс аннатовая - кущ, з тропічних областей американського континенту.\nТермостабільність, светостойкость- хороша! \nЗастосування: фарбування тесту, морозиво, сир, глазур, тістечка / печива, копченості. \nВідтінок: жовтий, помаранчевий. Рекомендації з Дозування: 0,005-0,1%.'),(29,'0;cad61095-9aac-11e4-a570-2e85dff2b333','Барвник Аннатто натуральний порошок','barvnik_annatto_naturalnii_poroshok','Tanya Exports','E 160 b. Цветовой оттенок:	Оранжево - красный. Рекомендации по дозировке:	0,02-0,17%	Мороженое, сыр, глазури, пирожные/печенья, копчёности'),(30,'0;cad6109d-9aac-11e4-a570-2e85dff2b333','Барвник Антоціанін','barvnik_antocianin','Naturex Ltd','Е 163. Концентрація пігментів: 1% антоцианина. Термостабільність, светостойкость- хороша. Застосування: напої, фруктові добавки, морозиво, кондитерські вироби, желе. Відтінок: червоний, фіолетовий. Рекомендації з дозування: 0,1-0,3%.\nпофарбовані рослинні глікозиди, знаходяться в рослинах, зумовлюючи че