ТОВ \"УкрАрома\"','Нет описания'),(40,'0;e027975e-e179-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Апероль','aromatizator_harchovii_aperol','ТОВ \"ВМ Про\"','Нет описания'),(41,'0;a41577fb-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Арахіс','aromatizator_harchovii_arahis','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка	Не более 300 г на 100кг готового продукта'),(42,'0;6ef8c524-2190-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Арахіс','aromatizator_harchovii_arahis','ТОВ \"Компанія Лев-Украіна\"','Нет описания'),(43,'0;a41577ff-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кавун','aromatizator_harchovii_kavun','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка	0,800 - 1,200 кг на 1т готового продукта.'),(44,'0;65cbf748-2197-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Кавун','aromatizator_harchovii_kavun','ТОВ \"Компанія Лев-Украіна\"','Нет описания'),(45,'0;79786dc9-e07b-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Кавун','aromatizator_harchovii_kavun','ТОВ \"УкрАрома\"','Нет описания'),(46,'0;dbce9a4f-0dd9-11e6-90ca-623365396135','Ароматизатор харчовий Кавун','aromatizator_harchovii_kavun','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(47,'0;d10eb2fc-9aac-11e4-a570-2e85dff2b333','Аскорбінова кислота Е-300','askorbinova_kislota_e-300','HUGESTONE ENTERPRISE CO., LTD','Аскорбиновая кислота (витамин С,Е300) — порошок белого цвета, один из сильнейших антиокислителей. По данным Комитета по пищевым добавкам Всемирной организации здравоохранения, аскорбиновая кислота в дозе, не превышающей 0,5 мг/кг массы тела человека, безопасна для организма.\nАскорбиновая кислота, как природный антиоксидант, используется для предотвращения окислительной порчи жиров в продуктах питания. Она прерывает реакции самоокисления в компонентах пищевых изделий, предотвращая снижение органолептических характеристик продуктов и изменению их окраски.\nАскорбиновая кислота увеличивает срок хранения продуктов в несколько раз. Она замедляет ферментативное окисление вина, пива и безалкогольных напитков, предохраняет фрукты, овощи и продукты их переработки от потемнения при замораживании, консервировании и расфасовке, сохраняя в них витамины. Аскорбиновая кислота позволяет на треть снизить количество нитритов и нитратов, необходимых в мясных изделиях. Она обеспечивает устойчивый и равномерный посол, ускоряет процесс консервирования, замедляет образование метмиоглобина на поверхности мяса.\nАскорбиновая кислота используется в следующих целях:\nдля обогащения продуктов питания витамином С (фруктовые соки, безалкогольные напитки, сухие напитки, фруктовые и овощные пюре, сухие завтраки, леденцы, мармелад, жевательная резинка);\nдля стандартизации содержания витамина С (фруктовые и овощные соки, пюре, консервы);\nдля стабилизации продуктов питания и напитков , как антиоксидант (добавление в процессе переработки или перед упаковкой позволяет сохранить цвет, запах и питательную ценность);\nкак улучшитель муки и теста (добавление витамина С в свежую муку улучшает ее пекарские качества, тем самым экономя 4-8 недель, необходимых для созревания муки после помола);\nдля стабилизации цвета свежего мяса и мясных продуктов, снижения необходимого количества добавляемых нитритов и уменьшения нитритного остатка в готовом продукте.\nРекомендуемые дозировки препарата для различных продуктов:\nВареные колбасы	0,3 кг на тонну фарша\nБекон, солонина, окорока	2,5 кг на тонну фарша\nСвежемороженая, копченая, сушеная рыба	5 - 12,5 кг на 1000 л воды\nБутылочное вино	0,12\nПиво	0,03\nБезалкогольные напитки и соки	0,15\nСвежемороженые ягоды и фрукты	0,5\nКонсервированные фрукты	1 - 2\nСоусы, приправы	0,1'),(48,'0;d10eb300-9aac-11e4-a570-2e85dff2b333','Аспартам','aspartam','Артикул не задан','Аспартам (E951) - это низкокалорийный подсластитель приблизительно в 200 раз слаще сахара. Он усваивается организмом, но благодаря высокому коэффициенту сладости, используемое количество аспартама настолько незначительно, что его можно считать фактически свободным от калорий.\nСвойства: \nПо вкусу очень близок к сахару. Подчеркивает и усиливает вкус фруктов и особенно цитрусовых. Можно снизить количество калорий в напитках и продуктах за счет замены сахара аспартамом. Крошечное количество аспартама с 1/10 калории дает тот же самый уровень сладости как чайная ложка сахара с 16 калориями. Не вызывает кариеса зубов. Допустимая дневная доза (ADI) для аспартама была установлена в 40 мг на килограмм веса тела человека (JECFA).'),(49,'0;d10eb38c-9aac-11e4-a570-2e85dff2b333','Калію ацесульфам','kaliyu_acesulfam','HUGESTONE ENTERPRISE CO., LTD','Ацесульфам К (Е950)-бескалорийный подсластитель\nОтносительная сладость:\nв 130 – 200 раз слаще сахара.\nСвойства: \nЗамена сахара ацесульфамом К в пищевых продуктах и напитках позволяет значительно снизить их калорийность. Дает быстрое ощущение сладости во рту. Имеет длительные сроки хранения и высокую стабильность при приготовлении и обработке пищевых продуктов. Термостабилен, поэтому пригоден для варки и выпечки. Не способствует образованию кариеса. Показан людям, страдающим сахарным диабетом. В комбинации с другими интенсивными подсластителями дает хороший синергический эффект (в особенности в комбинации с аспартамом).\nПрименение:\n-газированные и негазированные напитки\n- фруктовые сиропы \n- «сухие» напитки\n- горячие напитки\n- столовые подсластители\n- молочные продукты\n- мороженое\n- десерт, желатины\n- консервированные фрукты, желе\n- выпечки и кондитерские изделия\n- жевательная резинка\n- маринады\n- зубная паста\n- фармацевтика.\nДопустимая дневная доза потребления (ADI) для ацесульфама К была установлена в количестве 15 мг на кг веса тела (JECFA).'),(50,'0;a4157807-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Базилік','aromatizator_harchovii_bazilik','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка	0,800 - 1,200 кг на 1т готового продукта.'),(51,'0;be246af6-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Базил