я  дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(61,'0;b7a1e01e-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Барбарис','aromatizator_harchovii_barbaris','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(62,'0;b2c2424d-e069-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Барбарис','aromatizator_harchovii_barbaris','ТОВ \"УкрАрома\"','Нет описания'),(63,'0;584eed5e-123d-11e8-85db-cab4f2128b62','Ароматизатор харчовий Барбарис','aromatizator_harchovii_barbaris','ТОВ \"УкрАрома\"','Нет описания'),(64,'0;b0c257bd-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Бейліс','aromatizator_harchovii_beilis','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(65,'0;6b39ab4a-21a0-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Бейліс (крем-лікер)','aromatizator_harchovii_beilis_(krem-liker)','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(66,'0;b7a1df0b-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Бекон','aromatizator_harchovii_bekon','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(67,'0;de1167b5-9aac-11e4-a570-2e85dff2b333','Бензальдегід','benzaldegid','P.W. Centro-chem Sp.J.','плотность 1литр=1,04кг'),(68,'0;d10eb308-9aac-11e4-a570-2e85dff2b333','Бензоат натрію','benzoat_natriyu','Артикул не задан','Е 211(консервант)Защищает продукты от плесневения и брожения. Действие бензоата натрия направлено против дрожжей и плесневых грибов, некоторых бактерий (молочнокислых,  уксуснокислых и БГКП).  Эффективность применения возрастает в кислой среде (рН 3,8- 4,5). Стабилен при кипячении. Превосходно растворяется в воде.\nКак применяется: бензоат натрия растворяют в небольшом количестве питьевой воды (в 100 мл воды растворяется 50 г бензоата натрия). Затем этот раствор вносят в продукт. Стадия внесения консерванта в продукт определяется технологией его производства. Оптимальным считается момент сразу после пастеризации или стерилизации. \nДозировка\n•	мясопродукты — 0,1—0,4 %;\n•	повидло, меланжо, кондитерские изделия — 700 мг/кг;\n•	плодово-ягодные полуфабрикаты и маргарин — 1000 мг/кг;\n•	рыбная икра и рыбные консервы — 1000—2000 мг/кг;\n•	безалкогольные напитки — 150 мг/л;\n•	алкогольные напитки с уровнем алкоголя менее 15 % — 200 мг/л;\n•	джемы с малым содержанием сахара, желе, мармелады, фруктовые пасты — 500 мг/кг;\n•	безалкогольное пиво — 200 мг/л\nМаргарины	100 - 120г/100 кг\nМайонез, кетчупы, соусы	160г/100 кг\nМеланж	70г/100 кг\nПресервы рыбные	120г/100 кг\nСельдь, килька	260г/100 кг\nРыбная икра	100 - 200г/100 кг\nФруктовые полуфабрикаты	120 - 240г/100 кг\nКондитерские изделия	50 - 70г/100 кг'),(69,'0;a415781b-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Бергамот','aromatizator_harchovii_bergamot','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(70,'0;46b9e7a2-e06a-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Бергамот','aromatizator_harchovii_bergamot','ТОВ \"УкрАрома\"','Нет описания'),(71,'0;cad610ad-9aac-11e4-a570-2e85dff2b333','Барвник Бета-каротин Е 160а, 1% ж/р','barvnik_beta-karotin_e_160a,_1%_zh/r','ТОВ \"Компанія \"Лев-Україна\"','Е 160а. Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування: 0,03-0,09 % -  молочні продукти, маргарини, борошняні вироби, сири, прикраси  та глазурі'),(72,'0;cad610b0-9aac-11e4-a570-2e85dff2b333','Барвник Бета-каротин','barvnik_beta-karotin','DSM Nutritional Products Ltd','Нет описания'),(73,'0;cad610bc-9aac-11e4-a570-2e85dff2b333','Барвник Бета-каротин','barvnik_beta-karotin','DSM Nutritional Products France','Е 160а. Концентрация пигментов: 30% бета-каротина. Термостабильность, светостойкость- хорошая. Применение: напитки, желе, фруктовые добавки, кондитерские изделия, приправы. Оттенок: золотисто-оранжевый. Рекомендации по дозировке: 0,1-0,25%.\nПроизводится путем химического синтеза из водорослей'),(74,'0;cad610a9-9aac-11e4-a570-2e85dff2b333','Барвник Бета-каротин Е 160а, 5% ж/р','barvnik_beta-karotin_e_160a,_5%_zh/r','ТОВ \"Компанія \"Лев-Україна\"','Е 160а. Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування: 0,005-0,02 % -  молочні продукти, маргарини, борошняні вироби, сири, прикраси  та глазурі'),(75,'0;cad610c8-9aac-11e4-a570-2e85dff2b333','Барвник Бетанін буряковий екстракт','barvnik_betanin_buryakovii_ekstrakt','Naturex Ltd','Е 162. Концентрація пігментів: 0,5% бетаніну. Термостабільність-слабка, светостойкость- помірна. Застосування: морозиво, молочні продукти, фруктові добавки, тістечка / печива. Відтінок: рожевий, червоний. Рекомендації з дозування: 0,05-0,5%.\nАлкалоідоподобние з\'єднання, що отримується з харчової буряка, частіше з екстракту її соку'),(76,'0;a415783f-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Бісквіт','aromatizator_harchovii_biskvit','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(77,'0;8e99c71f-2438-11e7-a6d5-cab4f2128b62','Блеск','blesk','Артикул не задан','E102+E124+E132. Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,050-0,100 кг/т'),(78,'0;8da4e231-e06a-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Бренді','aromatizator_harchovii_brendi','ТОВ \"УкрАрома\"','Ароматизатор соответствует названию по вкусу и аромату.\nВ настоящее время в условиях падения импорта крепкого алкоголя растет популярность напитков, напоминающих ром или виски, так называемых «ромовых» или «висковых» напитков. Находчивые производители предлагают крепкие  алкогольные напитки (горькие настойки или коктейли) со вкусом виски, рома, текилы,  джина и др.\nВ нашей коллекции имеются ароматизаторы со вкусом различных видов виски (шотландского, ирландского, Бурбон и др.), рома, текилы и других крепких напитков. Эти ароматизаторы отвечают тенденциям рынка и разработаны с учетом вкусовых предпочтений украинской аудитории.\nТак же данный ароматизатор применяется в кондитерской и молочной промышленности, в производстве жидкости для электронных сигарет \"жижи\", и других пищевых продуктах.\nДозировка 0,8 ― 1,2кг на 1 тонну готового продукта.\nУпаковка канистра 9кг, бутылка пластиковая 1кг, флакон стекло 30г, флакон пластик 10г и флакон 1г'),(79,'0;cad6104d-9aac-11e4-a570-2e85dff2b333','Барвник Діамантовий блакитний','barvnik_diamantovii_blakitnii','MASCOT FOOD COLOURS','Пищевой краситель Синий блестящий FCF, (brilliant blue FCF,) применяется для окрашивания кондитерских изделий, и других пищевых продуктов. Белковый крем рекомендуем окрашивать порошком. Мастику - жидким бриллиантовым\nФасовка 25кг, 1кг, 100г для порошков. 1кг и 100г для жидкой формы.\nДозировка для порошка 2-5г / 100кг продукта\n                 для жидкости 50г/100кг продукта'),(80,'0;ced7ac99-e06a-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Бузина','aromatizator_harchovii_buzina','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(81,'0;aa1744d5-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Буратіно','aromatizator_harchovii_buratino','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(82,'0;d10eb323-9aac-11e4-a570-2e85dff2b333','Ванілін','vanilin','FOODCHEM INTERNATIONAL CORPORATION','Ванилин применяется для придания продуктам и напиткам ванильного аромата, усиления других, например шоколадного или клубничного, ароматов, а также маскировки или смягчения нежелательных побочных привкусов и запахов, например привкуса кипячения в молочных продуктах или жира в сдобе. Широко используется в кондитерском, прежде всего шоколадном, производстве, в производстве сдобы, творожных сырков, мороженого, ликёро-водочных изделий и т.д. \nВанилин следует добавлять в таком количестве, как указано в рецепте, но если вы готовите свое блюдо, то рекомендуется добавлять ванилин в пропорции: 1 грамм ванилина для ароматизации 1 килограмма теста.Растворяется в воде в соотношении 1:20 при температуре 80°С; в этаноле 95%-м в соотношении 2:1 при слабом нагревании; в пропиленгликоле - 220 г/л (20Х), 700 г/л (40°С). Температура плавления 80,5 – 82 °С\nРекомендуемые количества, кг/т:\nВыпечка……………………….…………………0,8-2,0\nШоколад и шоколадные изделия………………0,5\nКарамель, кондитерские массы…………………1,0\nСбивные кондитерские массы…………………..1кг\nКремы сливочные………………………………..0,4кг\nКремы белковые, заварные……………….…..…0,5кг\nМолочные продукты…………………….…..…...0,3\nМороженое…………………………………….….0,5-1кг\nЖевательная резинка…………………..………...0,5кг\nБезалкогольные напитки……………….………..0,2кг\nАлкогольные напитки…………………………… 0,2кг\nВ изделия подвергающиеся тепловой обработке ваниль вводят либо непосредственно перед ней (в тесто) либо сразу после пока блюдо ещё не остыло (в пудинги, суфле, компоты, варенье и т. п.). В холодные блюда (творожные пасты) после приготовления. Изделия требующие пропитки (бисквиты, торты) ваниль вводят в виде ванильного сиропа уже после выпечки.'),(83,'0;d10eb327-9aac-11e4-a570-2e85dff2b333','Ароматизатор Ваніль порошок','aromatizator_vanil_poroshok','ТОВ \"УкрАрома\"','Ароматизатори призначені для використання в харчовій промисловості для надання запаху та смаку виробам харчової промисловості (виробництво алкогольних і безалкогольних напоїв, кондитерських виробів, молочних продуктів, морозива, кремів, напівфабрикатів, кисломолочних продуктів, жирових продуктів, маргаринів)\nДозування:	Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(84,'0;d10eb332-9aac-11e4-a570-2e85dff2b333','Ванілін етіл','vanilin_etil','Foodchem International Corporation','Этилванилин представляет собой мелкие белые или слегка желтоватые кристаллы, либо кристаллический порошок.\nЭтилванилин самый популярный искусственный ароматизатор. Применяется для придания продуктам и напиткам ванильного аромата, усиления других, например шоколадного или клубничного, ароматов, а также маскировки или смягчения нежелательных побочных привкусов и запахов, например привкуса кипячения в молочных продуктах или жира в сдобе. Используется в кондитерском производстве, в производстве сдобы, творожных сырков, мороженого, ликёро-водочных изделий и т.д. как дешёвый заменитель ванилина. Его запах близок к запаху ванилина, но в 4 раза интенсивнее. Интенсивность аромата зависит от качества этилванилина.\nСпособ применения тот же, но дозировка примерно в 4 раза меньше.\nЭтилванилин используется как недорогой заменитель ванилина.\nРекомендуемые дозировки этилванилина\nКоличество этилванилина, г/т готовой продукции \nКондитерские изделия	0,700-1000\nМолочная промышленность	15-30\nВкусо-ароматические смеси	25-7'),(85,'0;a415781f-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"ВМ Про\"','Компания Market Pro (Маркет Про) (Ворлд Маркет), специализируется на создании и производстве ароматизаторов. \nВашему вниманию представлены сухие и жидкие ароматизаторы, применяемые в производстве различных видов молочной продукции и мороженом, десертов, кремов, а так же всех кондитерских изделий  и прочих пищевых продуктах.\n	Рекомендуемые дозировки 0,800 - 1,2кг являются ориентировочными и уточняются в каждом конкретном случае в зависимости от типа продукта,  его рецептуры, технологических параметров производства,   особенностей применяемого сырья и желаемой интенсивности аромата и вкуса.'),(86,'0;a4157827-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(87,'0;a415782f-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"ВМ Про\"','Рекомендуемая  дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(88,'0;b7a1e026-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Ароматизатори УкрАрома ТМ, термостійкі.\nВашій увазі представлені сухі і рідкі ароматизатори, які застосовуються у виробництві різних видів молочної продукції і морозива, десертів, кремів, а так само всіх кондитерських виробів і інших харчових продуктах.\nРекомендовані дозування 0,800 - 1,2 кг/1т готового продукту в залежності проходить продукт термообробку чи ні.\nНадаємо зразки деяких видів кондитерських виробів в готовому вигляді. Замов у менеджера нашої компанії дігустаціонний зразок печива або маршмеллоу.\nФасовка аромату: каністра (10кг, пляшка пластикова 1кг, пляшка скляна 30г, і флакон 1г'),(89,'0;b7a1e022-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(90,'0;c09498c5-21a6-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(91,'0;1f37d87b-e06c-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Нет описания'),(92,'0;61922056-e06c-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Нет описания'),(93,'0;afccfd2a-e06c-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Нет описания'),(94,'0;f0d16fdd-e06c-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Нет описания'),(95,'0;3d641044-e06d-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(96,'0;a415770c-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\nДозировка к массе готового продукта, 8,0 - 10,0%\nПредельно допустимая дозировка	Не более 12 % к готовому продукту'),(97,'0;a4157708-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Ваніль','aromatizator_harchovii_vanil','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\n*Напитки дозировка 0,03-0,05 % к готовому продукту\n*Каши дозировка 0,05-0,07 % к готовому продукту\n*М