укта.'),(122,'0;cd049ae0-dbb7-11e5-875f-623365396135','Ароматизатор харчовий Вiскi','aromatizator_harchovii_viski','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(123,'0;f86d848c-e06d-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Віскі','aromatizator_harchovii_viski','ТОВ \"УкрАрома\"','Ароматизатор відповідає назві за смаком і ароматом.\nВ даний час в умовах падіння імпорту міцного алкоголю зростає популярність напоїв, що нагадують ром або віскі, так званих «ромових» або «Віскова» напоїв. Винахідливі виробники пропонують міцні алкогольні напої (гіркі настоянки або коктейлі) зі смаком віскі, рому, текіли, джину та ін.\nВ нашій колекції є ароматизатори зі смаком різних видів віскі (шотландського, ірландського, Бурбон і ін.), Рома, текіли та інших міцних напоїв. Ці ароматизатори відповідають тенденціям ринку і розроблені з урахуванням смакових переваг української аудиторії.\nТак само даний ароматизатор застосовується в кондитерській і молочної промисловості, у виробництві рідини для електронних сигарет \"рідини\", і інших харчових продуктах.\nДозування 0,8 - 1,2 кг на 1 тонну готового продукту.\nУпаковка каністра 9кг, пляшка пластикова 1кг, флакон скло 30г, флакон пластик 10г і флакон 1г\nПідфарбовуйте ваш продукт натуральним барвником палений цукор!'),(124,'0;a415786f-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Вишня','aromatizator_harchovii_vishnya','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(125,'0;f65cf6ce-7140-11e7-a8a3-cab4f2128b62','Ароматизатор харчовий Вишня інкапсульований','aromatizator_harchovii_vishnya_inkapsulovanii','ТОВ \"ВМ Про\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування 10 кг/т'),(126,'0;a415787b-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Вишня','aromatizator_harchovii_vishnya','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(127,'0;a4157873-9aac-11e4-a570-2e8