в, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\n*Каши дозировка 0,07-0,14 % к готовому продукту\nПредельно допустимая дозировка	Не более 14 % к готовому продукту'),(134,'0;aa174389-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Водка','aromatizator_harchovii_vodka','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(135,'0;a4157857-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Глінтвейн','aromatizator_harchovii_glintvein','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(136,'0;d10eb33c-9aac-11e4-a570-2e85dff2b333','Гліцерин','glicerin','P.W. Centro-Chem SP.J.','Глицерин пищевой используется как добавка Е422 в производстве кондитерских изделий для улучшения консистенции, для предотвращения проседания шоколада, увеличения объема хлеба.Глицерин относится к группе стабилизаторов, обладающих свойствами сохранять и увеличивать степень вязкости и консистенции пищевых продуктов, используется в качестве эмульгатора, при помощи которого смешиваются различные несмешиваемые смеси.\nВ последние годы глицерин используется, наряду с пропиленгликолем, в качестве основного компонента для приготовления жидкости и картриджей для электронных сигарет.\nДобавление глицерина пищевого уменьшает время зачерствения хлебных изделий, делает макароны менее клейкими, уменьшает налипание крахмала при выпечке.\nГлицерин применяется для получения пищевых поверхностно-активных веществ,при изготовлении экстрактов кофе, чая, имбиря и других растительных веществ, которые мелко измельчают и обрабатывают водным раствором глицерина, нагревают и испаряют воду. Получается экстракт, в котором содержится около 30% глицерина.\n\nГлицерин пищевой широко используется при производстве безалкогольных напитков. Экстракт, приготовленный на основе глицерина, в разбавленном состоянии придает напиткам «мягкость».\n\n1литр = 1.26кг'),(137,'0;d10eb340-9aac-11e4-a570-2e85dff2b333','Натрію глютамінат харч','natriyu_glyutaminat_harch','HUGESTONE ENTERPRISE CO., LTD.','Е621,применяется в качестве усилителя вкуса и аромата/заменителя соли в пищевой промышленности:\n•	пищеконцентратные продукты (смеси специй, супы, бульонные кубики, чипсы, рыбные закуски к пиву, блюда быстрого приготовления и пр.)\n•	масложировые продукты (майонезы, кетчупы)\n•	консервные и мясные продукты (мясные полуфабрикаты и пр.)\n•	корейские салаты;\n•	консервы\nхорошо растворимый в воде.\nДозировки: \nКолбасные изделия, продукты из свинины, говядина, баранина, конина, полуфабрикаты и др-.0.05-0.15 %\nКонсервированные море- и рыбопродукты-0.1-0.5 %\nГлутамат натрия может добавляться в продукт вместе с солью. При этом дозировку соли уменьшают на 10%. \nДля мясопереработки дозировка глютамата натрия составляет 0,05-0,2% к массе готового продукта, т.е. 50-200 г на 100 кг продукта.'),(138,'0;cf73d1bc-21b1-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Яловичина','aromatizator_harchovii_yalovichina','ТОВ \"Компанія Лев-Украіна\"','Ароматизатор применяется в производстве мясопереработке, колбасных изделиях, в корм для домашних и сельскохозяйственных животных,  в корм для рыбной ловли и т.п.\nДозировка подбирается индивидуально для продукта, примерно  0,8-1,2кг на 1 тонну готового продукта.\nУпаковка канистра 10кг, бутылка пластиковая 1кг, флакон 30г, бутылочка 10г и флакон 1г.'),(139,'0;16cd6aa8-21b3-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Яловичина','aromatizator_harchovii_yalovichina','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(140,'0;cad61140-9aac-11e4-a570-2e85dff2b333','Барвник Виноградний суміш','barvnik_vinogradnii_sumish','ТОВ \"Компанія Лев-Украіна\"','Використовують для фарбування тесту, мастики, і багатьох харчових продуктів. Для яскравого фарбування білкового крему використовуйте порошкоподібні барвники.'),(141,'0;aa17438d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Горох','aromatizator_harchovii_goroh','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(142,'0;a4157724-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Горох зеленый','aromatizator_harchovii_goroh_zelenii','ТОВ \"Компанія Лев-Украіна\"','Нет описания'),(143,'0;b7a1e045-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Гірчиця','aromatizator_harchovii_girchicya','ТОВ \"УкрАрома\"','Ароматизаторы горчицы,  самые востребованные в производстве майонезов. Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, для майонезов 0,4 кг/т\nДля крекеров 0,3кг на 100кг готового прод.'),(144,'0;52fb4510-8b9f-11e6-908b-cab4f2128b62','Готовый продукт','gotovii_produkt','Артикул не задан','Нет описания'),(145,'0;aa174391-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Гранат','aromatizator_harchovii_granat','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(146,'0;aa174395-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Гранат','aromatizator_harchovii_granat','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(147,'0;699e0b31-21b3-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Гранат','aromatizator_harchovii_granat','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(148,'0;aa174399-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Грейпфрут','aromatizator_harchovii_greipfrut','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(149,'0;aa17439d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Волоський горіх','aromatizator_harchovii_voloskii_gorih','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.