 кг на 1т готового продукта.'),(180,'0;b14b5c14-e06f-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Жасмін','aromatizator_harchovii_zhasmin','ТОВ \"УкрАрома\"','Нет описания'),(181,'0;cad61146-9aac-11e4-a570-2e85dff2b333','Барвник Жовтий суміш','barvnik_zhovtii_sumish','ТОВ \"Компанія Лев-Украіна\"','Використовують для фарбування тіста, мастики, і багатьох харчових продуктів. Для яскравого фарбування білкового крему використовуйте порошкоподібні барвники.'),(182,'0;cad610df-9aac-11e4-a570-2e85dff2b333','Барвник Цукор палений','barvnik_cukor_palenii','ТОВ \"УкрАрома\"','Е 150а. Барвник харчовий натуральний світло коричневий призначений для використання в харчовій промисловості для надання кольору та смаку безалкогольним напоям, алкогольним напоям, кондитерським виробам та іншим харчовим продуктам. Вироблен методом паління  цукру. для напитков коньячній оттенок до 15кг/1000л.'),(183,'0;b0c258a5-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Замутнювач терпеновий','aromatizator_harchovii_zamutnyuvach_terpenovii','ТОВ \"ВМ Про\"','Рекомендуемая дозировка 	0,800 - 1,200 кг на 1т готового продукта.'),(184,'0;cad6114c-9aac-11e4-a570-2e85dff2b333','Барвник Зелене Яблуко суміш','barvnik_zelene_yabluko_sumish','ТОВ \"Компанія Лев-Украіна\"','Сумішний барвник Е102, Е133, застосовується в харчових продуктах, водорозчинний. Інтенсивність кольору регулюється дозуванням. Порошкооподібний бавник дуже летючий, і тому бруднить все навколо, рекомендуємо використовувати барвник в рідкій, гелеобразній формі на гліцерині.\nФасовка 25кг, 1 кг, 100г\nДозування для порошку 2-5г / 100кг готового продукту\n                   для рідини 20-50г / 100кг продукту\n\nГелевий барвник відмінно підходить для фарбування яєць.\nСпосіб фарбування: Перш ніж фарбувати яйця, їх спочатку треба відварити до повної готовності, остудити. В каструльку налийте теплої води (0,5л), додайте оцет (1 ст.л.) і 10 крапель гелевого барвника  . Опустіть яйця в готовий розчин так, щоб він покривав повністю яйце. Час фарбування яйця 3-4-хвилини.\nДля яскравого фарбування білкового крему використовуйте порошкоподібні барвники.'),(185,'0;cad61149-9aac-11e4-a570-2e85dff2b333','Барвник Зелене яблуко','barvnik_zelene_yabluko','ТОВ \"Компанія \"Лев-Україна\"','E102+E133. Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,050-0,100 кг/т'),(186,'0;aa1743c9-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Суниця','aromatizator_harchovii_sunicya','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(187,'0;aa17455d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Суниця','aromatizator_harchovii_sunicya','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(188,'0;aa1743c5-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Суниця','aromatizator_harchovii_sunicya','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(189,'0;cad6114f-9aac-11e4-a570-2e85dff2b333','Барвник Золота рибка','barvnik_zolota_ribka','ТОВ \"Компанія Лев-Украіна\"','Сумішний харчовий барвник Е102, Е110,  водорозчинний. Поморанчевий кольор. Застосовується в кондитерських та молочних продуктах. Інтенсивність кольору регулюється дозуванням. Порошкооподібний бавник дуже летючий, і тому бруднить все навколо, рекомендуємо використовувати барвник в рідкій, гелеобразній формі на гліцерині.\nФасовка 25кг, 1 кг, 100г\nДозування для порошку 2-5г / 100кг готового продукту\n                   для рідини 20-50г / 100кг продукту'),(190,'0;d10eb3a4-9aac-11e4-a570-2e85dff2b333','Изомальтит','izomaltit','Артикул не задан','Нет описания'),(191,'0;aa1743cd-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Икра (червона)','aromatizator_harchovii_ikra_(chervona)','ТОВ \"ВМ Про\"','Рекомендуемая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(192,'0;aa1743d5-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Имбир','aromatizator_harchovii_imbir','ТОВ \"ВМ Про\"','Рекоменду