є ефективним інструментом у створенні будь-якого продукту з унікальним смаком.\nНаприклад у всьому світі зростає популярність ароматизованої кави в зернах. Смаки для кави в зернах можуть бути самими різними. Найпопулярнішими смаками для кави в зернах є кондитерські та алкогольні, кава зі смаком десертів (Тірамісу, крем-дотримувала), випічки (бісквіт, здоба), кондитерських виробів (Баунті, ірис, карамель, Рафаелло), морозива (пломбір).\nПри створенні кондитерських виробів з шоколадним смаком, застосування серії шоколадних ароматизаторів, що включає аромати темного і молочного шоколаду з різними відтінками, дуже важливо, оскільки застосування одного какао-порошку у багатьох випадках не дає бажаної яскравості смаку і аромату.\nЗастосування горіхових ароматизаторів має цілий ряд переваг: зниження собівартості, спрощення технологічних процесів, стабілізація і поліпшення смаку, запобігання забруднення мікроорганізмами і афлатоксинами, а також прогоркания.'),(260,'0;aa17444d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кокос','aromatizator_harchovii_kokos','ТОВ \"Компанія Лев-Украіна\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(261,'0;aa17443d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кокосовi вершки','aromatizator_harchovii_kokosovi_vershki','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(262,'0;aa174441-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кокосовi вершки','aromatizator_harchovii_kokosovi_vershki','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(263,'0;a80528d0-21bf-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Кокосовi вершки','aromatizator_harchovii_kokosovi_vershki','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(264,'0;aa174445-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кокосовий','aromatizator_harchovii_kokosovii','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(265,'0;b0c258b5-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кола','aromatizator_harchovii_kola','ТОВ \"ВМ Про\"','Окрашенная, темно количневая. БЕЗАЛКОГОЛЬНЫЕ НАПИТКИ	: 1 кг на 1000 литров готового напитка. НЕ ПОДХОДИТ в жижу'),(266,'0;714cdedb-1dd7-11e7-a6d5-cab4f2128b62','Ароматизатор харчовий Кола','aromatizator_harchovii_kola','ТОВ \"ВМ Про\"','Окрашенная, темно количневая. БЕЗАЛКОГОЛЬНЫЕ НАПИТКИ	: 1 кг на 1000 литров готового напитка. НЕ ПОДХОДИТ в жижу'),(267,'0;b0c258b1-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кола','aromatizator_harchovii_kola','ТОВ \"УкрАрома\"','БЕЗАЛКОГОЛЬНЫЕ НАПИТКИ	: 1 кг на 1000 литров готового напитка'),(268,'0;c7f5e8ae-1ee5-11e9-bfc0-7e85ef3200af','Комплексна харчова добавка Коллаген','kompleksna_harchova_dobavka_kollagen','Артикул не задан','Малая дозировка.\nОбразование стойкой эмульсии.\nВозможность работы производства по \"холодной технологии\".\nСнижение энергозатрат.'),(269,'0;ac67cf65-1eea-11e9-bfc0-7e85ef3200af','Комплексна харчова добавка Коллаген','kompleksna_harchova_dobavka_kollagen','Артикул не задан','Стабилизация консистенции.\nОбеспечение плотной эмульсии жира в воде.\nНе требует внесения изменений в технологический процесс производства.'),(270,'0;40c6e879-1ee6-11e9-bfc0-7e85ef3200af','Комплексна харчова добавка Коллаген','kompleksna_harchova_dobavka_kollagen','Артикул не задан','Преимущества:\n- Производство сгущеного молока, без вакуум выпарных установок;\n- Не требует изменений в технологическом процессе;\n- Значительно улучшает экономические показатели предприятия.'),(271,'0;8a46ce2a-1ee7-11e9-bfc0-7e85ef3200af','Комплексна харчова добавка Коллаген Pro для масло,спредов','kompleksna_harchova_dobavka_kollagen_pro_dlya_maslo,spredov','Артикул не задан','Премущества:\n- Исключает порок легкоплавкости;\n- Придает продукту пластичность'),(272,'0;aa174451-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Пряний (конопля)','aromatizator_harchovii_pryanii_(konoplya)','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(273,'0;aa17445d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Коньяк','aromatizator_harchovii_konyak','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.\nАроматизатор соответствует названию по вкусу и аромату.\nВ настоящее время в условиях падения импорта крепкого алкоголя растет популярность напитков, напоминающих ром или виски, так называемых «ромовых» или «висковых» напитков. Находчивые производители предлагают крепкие  алкогольные напитки (горькие настойки или коктейли) со вкусом виски, рома, текилы,  джина и др.\nВ нашей коллекции имеются ароматизаторы со вкусом различных видов виски (шотландского, ирландского, Бурбон и др.), рома, текилы и других крепких напитков. Эти ароматизаторы отвечают тенденциям рынка и разработаны с учетом вкусовых предпочтений украинской аудитории.\nТак же данный ароматизатор применяется в кондитерской и молочной промышленности, в производстве жидкости для электронных сигарет \"жижи\", и других пищевых продуктах.\nэто убираем'),(274,'0;aa174461-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Коньяк','aromatizator_harchovii_konyak','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(275,'0;aa174465-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Коньяк','aromatizator_harchovii_konyak','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.\nАроматизатор соответствует названию по вкусу и аромату.\nВ настоящее время в условиях падения импорта крепкого алкоголя растет популярность напитков, напоминающих ром или виски, так называемых «ромовых» или «висковых» напитков. Находчивые производители предлагают крепкие  алкогольные напитки (горькие настойки или коктейли) со вкусом виски, рома, текилы,  джина и др.\nВ нашей коллекции имеются ароматизаторы со вкусом различных видов виски (шотландского, ирландского, Бурбон и др.), рома, текилы и других крепких напитков. Эти ароматизаторы отвечают тенденциям рынка и разработаны с учетом вкусовых предпочтений украинской аудитории.\nТак же данный ароматизатор применяется в кондитерской и молочной промышленности, в производстве жидкости для электронных сигарет \"жижи\", и других пищевых продуктах.\nэто убираем'),(276,'0;254e96da-dbb9-11e5-875f-623365396135','Ароматизатор харчовий Коньяк','aromatizator_harchovii_konyak','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.\nАроматизатор соответствует названию по вкусу и аромату.\nВ настоящее время в условиях падения импорта крепкого алкоголя растет популярность напитков, напоминающих ром или виски, так называемых «ромовых» или «висковых» напитков. Находчивые производители предлагают крепкие  алкогольные напитки (горькие настойки или коктейли) со вкусом виски, рома, текилы,  джина и др.\nВ нашей коллекции имеются ароматизаторы со вкусом различных видов виски (шотландского, ирландского, Бурбон и др.), рома, текилы и других крепких напитков. Эти ароматизаторы отвечают тенденциям рынка и разработаны с учетом вкусовых предпочтений украинской аудитории.\nТак же данный ароматизатор применяется в кондитерской и молочной промышленности, в производстве жидкости для электронных сигарет \"жижи\", и других пищевых продуктах.\nэто убираем'),(277,'0;f627cc11-c354-11e5-aec9-b6fb3f5b2329','Ароматизатор харчовий Екстракт коріандру','aromatizator_harchovii_ekstrakt_koriandru','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(278,'0;9664f604-fe0c-11e4-93a5-b6fb3f5b2329','Ароматизатор харчовий Кориця','aromatizator_harchovii_koricya','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(279,'0;be246a88-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кориця','aromatizator_harchovii_koricya','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(280,'0;cad6105d-9aac-11e4-a570-2e85dff2b333','Барвник Коричневий','barvnik_korichnevii','Артикул не задан','Пищевой краситель Коричневый HT , (Brown HT,)  Пищевые красители окрашивают продукты и смеси. Придают привлекательный оттенок готовому продукту.\nФасовка 25кг, 1кг, 100г для порошков. 1кг и 100г для жидкой формы.\nДозировка для порошка 2-5г / 100кг продукта\n                 для жидкости 50г/100кг продукта'),(281,'0;81616010-8515-11e8-b1dd-cab4f2128b62','Ароматизатор харчовий Корично-Ванільний','aromatizator_harchovii_korichno-vanilnii','ТОВ\"УкрАрома\"','Нет описания'),(282,'0;aa174469-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"ВМ Про\"','Ароматизаторы являются эффективным инструментом в создании любого продукта с уникальным вкусом.\nК примеру во всем мире растет популярность ароматизированного кофе в зернах. Вкусы  для кофе в зернах  могут быть самыми разными. Самыми  популярными вкусами для кофе в зернах являются  кондитерские и алкогольные,  кофе со вкусом   десертов (Тирамису, крем-блюле), выпечки (бисквит, сдоба), кондитерских изделий (Баунти, ирис, карамель, рафаэлло), мороженого (пломбир).'),(283,'0;aa17446d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(284,'0;be246a8c-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(285,'0;aa174471-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"УкрАрома\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(286,'0;4dd4c67b-e079-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"УкрАрома\"','Нет описания'),(287,'0;a415774c-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\n*Напитки дозировка 0,05-0,1 % к готовому продукту\nПредельно допустимая дозировка	Не более 10 % к готовому продукту'),(288,'0;28c57c22-21c0-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Кава','aromatizator_harchovii_kava','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(289,'0;f08f06a3-2266-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Краб','aromatizator_harchovii_krab','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(290,'0;aa174485-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Краби (опариш)','aromatizator_harchovii_krabi_(oparish)','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(291,'0;aa17447d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Краби','aromatizator_harchovii_krabi','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(292,'0;aa174481-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Краби','aromatizator_harchovii_krabi','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(293,'0;cad61155-9aac-11e4-a570-2e85dff2b333','Барвник Червоний суміш','barvnik_chervonii_sumish','ТОВ \"Компанія Лев-Украіна\"','Використовують для фарбування тесту, мастики, і багатьох харчових продуктів. Для яскравого фарбування білкового крему використовуйте порошкоподібні барвники.'),(294,'0;5dd33b1d-1e4f-11e9-bfc0-7e85ef3200af','Крахмал кукурузный восковидной кукурузы 90120','krahmal_kukuruznii_voskovidnoi_kukuruzi_90120','Артикул не задан','Сшитый\nПрименение:\nИспользуется в пищевой промышленности в качестве загустителя при производстве майонеза, соуса, кетчупов, максимальная вязкость достигается при разных температурных режимах нагревания-стерилизации. Выдерживает несколько циклов стерилизации, 30 циклов замораживания-размораживания.\nОсобенности:\nПредставляет собой белый, или почти белый порошок, не имеющий запаха. Порошок может состоять из гранул, из хлопьев аморфного порошка или грубых частиц.  \nКрахмал не теряет своих свойств даже при многоразовых циклах замораживания и оттаивания, а также увеличивает срок хранения продукции в низкотемпературных условиях.\nОн характеризуется устойчивостью  к действию ферментов, сред с разным рН, а также придает продуктам насыщенный цвет и блеск.\nТ (клс)=67-72С, Т(мах)=140С, рН=3,0-9,0.'),(295,'0;effbd87e-1e4e-11e9-bfc0-7e85ef3200af','Крахмал кукурузный модифицированный 31105','krahmal_kukuruznii_modificirovannii_31105','Артикул не задан','Тип окисленный жидко-заварной\nПрименение: \n- как стабилизатор в производстве мороженого, молочных пудингов;\n- в кондитерской промышленности - как структурообразователь для приготовления начинок, желейных изделий, лукума;\n- в выпечках хлеба - улучшает структуру теста;\n- для приготовления жидкой панировки для обжарки рыбы и мяса в промышленных условиях.\n Особенности: \n- однородное порошкообразное вещество светло-желтого, практически белого цвета без определенного запаха;\n- хорошо растворяется в холодной воде, при кипячении образует прозрачный клейстер пониженной вязкости, не растворим в спиртах;\n- склонен к гидролизу, сохраняет свойства при длительном хранении, устойчив к низким температурам.\nТ (мах)=105С, рН=7,0-9,0'),(296,'0;1b3f223c-1e4f-11e9-bfc0-7e85ef3200af','Крахмал кукурузный модифицированный 85120','krahmal_kukuruznii_modificirovannii_85120','Артикул не задан','Заварной дикрахмалфосфат\nПрименение:\n- при изготовлении хлебобулочных изделий, начинки для конфет;\n- для замороженных полуфабрикатов;\n- в кисломолочных продуктах, детском питании;\n- в колбасных изделиях;\n- а также в косметической и медицинской промышленности ( как покрытие для презервативов и медицинских перчаток, входит в состав медицинских препаратов).\nОсобенности:\nПорошкообразное вещество белого цвета без запаха. При образовании клейстера отличается прозрачной короткокапельной текстурой, а также стойкостью к высокотемпературному и механическому воздействию.\nТ (клс)=67-72С, Т(мах)=120С, рН=5,5-7,0.'),(297,'0;a3d59c7f-2268-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Креветковий соус','aromatizator_harchovii_krevetkovii_sous','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(298,'0;aa174489-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Крем-брюле','aromatizator_harchovii_krem-bryule','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(299,'0;aa17448d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Крем-брюле','aromatizator_harchovii_krem-bryule','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(300,'0;7e496726-e07c-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Крем-брюле','aromatizator_harchovii_krem-bryule','ТОВ \"УкрАрома\"','Нет описания'),(301,'0;aa174491-9aac-