о для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(310,'0;cad61102-9aac-11e4-a570-2e85dff2b333','Барвник Куркуміна екстракт','barvnik_kurkumina_ekstrakt','Naturex Ltd','Е 100. Концентрація пігментів: 8% куркумина. Куркумін - основний куркуміноїд, что входити до складу кореня куркуми.\nТермостабільність-хороша, светостойкость- слабка. Застосування: хлібні продукти, готова їжа, приправи, молочні продукти, морозиво. Відтінок: яскравий жовтий, зелений при низькому рН. Рекомендації з дозування: 0,005-0,05%.'),(311,'0;cad6110a-9aac-11e4-a570-2e85dff2b333','Барвник Куркуміна екстракт','barvnik_kurkumina_ekstrakt','Naturex Ltd','Е 100. Концентрация пигментов: 7,5% куркумина. Термостабильность-хорошая, светостойкость- слабая. Применение: десерты, глазури, сухие смеси, мучные изделия. Оттенок: яркий лимонный. Рекомендации по дозировке: 0,04-0,02%.'),(312,'0;aa174429-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лаванда','aromatizator_harchovii_lavanda','ТОВ \"ВМ Про\"','Нет описания'),(313,'0;6c22ef91-151c-11e7-a6d5-cab4f2128b62','Барвник Лак Діамантовий блакитний','barvnik_lak_diamantovii_blakitnii','Ajanta Chemical Industries','Нет описания'),(314,'0;d711f192-979c-11e7-988b-cab4f2128b62','Барвник Лак Зелене яблуко','barvnik_lak_zelene_yabluko','ТОВ \"Компанія Лев-Украіна\"','Нет описания'),(315,'0;8c1daf8e-151d-11e7-a6d5-cab4f2128b62','Барвник Кармуїзін лак','barvnik_karmuyizin_lak','Ajanta Chemical Industries','Нет описания'),(316,'0;cad6112e-9aac-11e4-a570-2e85dff2b333','Барвник Коричневый лак','barvnik_korichnevii_lak','Ajanta Chemical Industries','Нет описания'),(317,'0;7339e987-6cda-11e5-973d-b6fb3f5b2329','Барвник Понсо лак порошок','barvnik_ponso_lak_poroshok','Tanya Exports','Нет описания'),(318,'0;cad61061-9aac-11e4-a570-2e85dff2b333','Барвник Лак Сонячний захід','barvnik_lak_sonyachnii_zahid','Артикул не задан','Нет описания'),(319,'0;801e84f9-6cda-11e5-973d-b6fb3f5b2329','Барвник Тартразин лак порошок','barvnik_tartrazin_lak_poroshok','Артикул не задан','Нет описания'),(320,'0;aa1744a5-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісова ягода','aromatizator_harchovii_lisova_yagoda','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(321,'0;aa1744a9-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісова ягода','aromatizator_harchovii_lisova_yagoda','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(322,'0;aa17442d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісова ягода','aromatizator_harchovii_lisova_yagoda','ТОВ \"УкрАрома\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(323,'0;aa1744ad-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісовий горіх','aromatizator_harchovii_lisovii_gorih','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(324,'0;be246a90-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісовий горіх','aromatizator_harchovii_lisovii_gorih','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(325,'0;5111b057-e07e-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Лісовий горіх','aromatizator_harchovii_lisovii_gorih','ТОВ \"УкрАрома\"','Нет описания'),(326,'0;a4157754-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісовий горіх','aromatizator_harchovii_lisovii_gorih','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\nПредельно допустимая дозировка	Не более 12 % к готовому продукту. Дозировка для сравнительной оценки  соответствия запаха и вкуса: 0,05-0,1г на 100мл воды'),(327,'0;d10eb36e-9aac-11e4-a570-2e85dff2b333','Лецитин соєвий','lecitin_soyevii','PRISMA COM EXP DE OLEOQYIMICOS LTDA','Лецитин (Е322)является поверхностно-активным агентом — он хорошо работает на поверхности раздела фаз различных субстанций. В присутствии двух не смешиваемых жидких фаз, лецитин понижает поверхностное натяжение и действует как эмульгатор. Когда необходимо взаимодействие между твердой и жидкой фазой, лецитин действует как смачивающий и диспергирующий агент. При использовании между твердыми фазами, вещество работает как смазочный агент. Также лецитин хорошо себя зарекомендовал как агент высвобождения изделий из форм (снижает прилипание к формам).\nВ пищевой промышленности лецитины применяются с разными целями:\n-для создания и стабилизации однородных эмульсий из жиров, воды и других жидкостей\nблагодаря антиокислительным свойствам, лецитины способны увеличивать сроки годности продуктов питания (хлеб, сладкая выпечка, шоколад и другие кондитерские изделия)\n-добавка Е322 позволяет жирам дольше оставаться в жидком состоянии (препятствует быстрой кристаллизации жиров)\n-при выпекании мучных изделий лецитин предотвращает прилипание выпечки к формам\nпри жарке во фритюре эмульгатор Е322 значительно сокращает разбрызгивание масла\nВ производстве хлебобулочных изделий применение лецитина приводит к улучшению обрабатываемости теста, лучшему объему, увеличению сроков годности.\nЛецитин останавливает увлажнение и сводит к минимуму крошение вафельных изделий придавая им приятную окраску текстуре и естественный хруст.\nВ производстве крекеров, печений, кексов и пирогов применение лецитина улучшает свойства шортенинга и действует как агент высвобождения из форм. Лецитин также может применяться в пищевой промышленности как антиоксидант (вещество, которое препятствует окислению).\nПрименение лецитина дает возможность получить однородную мелко-пористую плотную структуру мякиша с ровным каркасом. Лецитин из подсолнечника – эмульгатор, который позволяет регулировать кислотность и укреплять клейковинный каркас.\nЛецитин хорошо растворяется в тесте и позволяет регулировать его консистенцию. Эмульгирующие свойства этого порошка упрощают машинную обработку теста за счет придания ему необходимой сухости. Результатом применения лецитина является значительное уменьшение процента бракованной продукции.\nКроме всего вышесказанного, лецитины могут заменить яйца, если их использование предусмотрено рецептурой приготовления. Лецитин не только станет полноценной альтернативой яйцам, но и улучшит такие характеристики теста, как слоистость и структура.\nПрименение лецитина в производстве кондитерских изделий придает тесту текучести, его цвету – однородности, а текстуре и структуре – гладкости. Ещё одна способность лецитина: придать готовой продукции равномерный цвет и снизить риски образования трещин.\nПри производстве печенья, благодаря лецитину легко образуется эластичное тесто. Печенье, приготовленное с помощью лецитина, становиться приятно рассыпчатым, так, что даже появляется возможность снизить содержание жира. Подсолнечный лецитин позволяет сократить потребность жиров примерно на 20 — 25% в печенье или каком-либо другом продукте. Кроме того, лецитин замедляет окисление жира, благодаря чему печенье останется свежим дольше.\nТакже подсолнечный лецитин помогает сформировать тонкую пленку вокруг частиц дрожжей в замороженной пицце, тем самым защищая изделия от шоковой заморозки и повреждений.\nОриентировочные дозировки лецитина: от 0,2% до 2% от массы муки.'),(328,'0;be246b01-9aac-11e4-a570-2e85dff2b333','Ароматизатор харч