'),(352,'0;a4157760-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Малина','aromatizator_harchovii_malina','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\nРекомендации по применению и дозировка:\nкондитерская промышленность (мучные изделия): 200-400 г на 100 кг \nкаши-инстант: 0,6-0,75% к сухой основе'),(353,'0;bf969981-0de6-11e6-90ca-623365396135','Ароматизатор харчовий Малина порош','aromatizator_harchovii_malina_porosh','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(354,'0;d10eb376-9aac-11e4-a570-2e85dff2b333','Мальтодекстрин 10-15','maltodekstrin_10-15','QINGDAO SHENGDA COMMERCIAL & TRADE CO., LTD','Мальтодекстрин Е1400. Декстрозное число  10-15.  Легко растворяется в воде, имеет свойства сгущения, тормозит кристаллизацию сахара, имеет эффект стабильного пенообразования. Обладает хорошей эмульгируемостью. Влияет на формообразование продукта, регулирует его структуру, низкое свойство всасывания влаги, трудно делимо на части, хорошее свойство формования, предохраняет продукт от изменения формы, улучшает внешний вид продукта.\nМальтодекстрин имеет в составе кислотоупорную соль и сырье, которое обладает свойством жарост