aromatizator_harchovii_provanski_travi','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(449,'0;d10eb396-9aac-11e4-a570-2e85dff2b333','Пропіленгліколь','propilenglikol','DOW EUROPE GMBH','1 литр = 1,04 кг\nУ харчовій промисловості пропіленглтколь використовується як пом\'якшувальну, влагоудерживающего і диспергуючого агента. Входить до складу вівсяного печива, безалкогольних та слабоалкогольних газованих напоїв, енергетичних напоїв, цукерок, бісквітних рулетів і деяких інших кондитерських виробів. Використовується при екстреному заморожуванні ягід, фруктів, м\'яса птиці. Інші застосування пропиленгликоля: - використовується у вигляді водного розчину в різних областях промисловості, як холодоносія (завдяки своїй низькій ступеня токсич\nності); - у виробництві косметики (шампунів, помад, еліксирів та ін.); - в фармацевтичної промисловості; - при виробництві пластмас.'),(450,'0;b0c25765-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Пунш','aromatizator_harchovii_punsh','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(451,'0;93dc5b31-6dbf-11e6-971d-cab4f2128b62','Ароматизатор харчовий Ред Булл','aromatizator_harchovii_red_bull','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т.ВИКОРИСТОВУЄТЬСЯ В ЕЛЕКТРОННИХ ЦИГАРКАХ.'),(452,'0;b0c25821-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Троянда','aromatizator_harchovii_troyanda','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(453,'0;aa174421-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Розмарин','aromatizator_harchovii_rozmarin','ТОВ \"ВМ Про\"','Нет описания'),(454,'0;fd3dd5d5-3c1b-11e9-9fd3-7e85ef3200af','Ароматизатор харчовий Розмарин','aromatizator_harchovii_rozmarin','ТОВ \"УкрАрома\"','Нет описания'),(455,'0;1fba05b8-3e5c-11e9-9fd3-7e85ef3200af','Ароматиза