-11e7-af61-cab4f2128b62','Ароматизатор харчовий Рибний (Черв\'як)','aromatizator_harchovii_ribnii_(cherv_yak)','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(471,'0;b7a1dfc3-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Горобина червона','aromatizator_harchovii_gorobina_chervona','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(472,'0;b0c2577d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Салямі','aromatizator_harchovii_salyami','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(473,'0;f417e080-5c2d-11e9-ad1c-cf97d286a631','Ароматизатор харчовий Сандра спешиал','aromatizator_harchovii_sandra_speshial','ТОВ \"УкрАрома\"','Арбуз+мята'),(474,'0;51532e8a-8e01-11e5-b26c-b6fb3f5b2329','Ароматизатор харчовий Саусеп','aromatizator_harchovii_sausep','ТОВ \"УкрАрома\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(475,'0;d10eb39d-9aac-11e4-a570-2e85dff2b333','Сахаринат натрію','saharinat_natriyu','HUGESTONE ENTERPRISE CO., LTD','Сахаринат натрия ( Е954 ).Относительная сладость. В 300-500 раз слаще сахара.\nСвойства. \nПри замене сахара сахарином в пищевых продуктах и напитках резко снижается количество калорий. Высокостабильный продукт, может долго храниться. Пригоден в производстве пищевых продуктов горячим способом и выпечках.\nНе вызывает кариеса зубов. Показан людям, страдающим сахарным диабетом.\nВ комбинации с другими интенсивными подсластителями дает хороший синергический эффект.\n\nОграничения.\nПри превышении допустимых норм закладки дает горьковатое послевкусие, поэтому в чистом виде используется редко –как правило, в смесях с другими подсластителями\n\nПрименение: \n\n-газированные и негазированные напитки.\n-соки\n-пудинги, желе\n-молочные продукты\n-столовые подсластители\n-сидр, соленья, соусы\n-рыбные и фруктовые презервы\n-жевательная резинка\n-джемы, мармелады\n-фармацевтика\n-кондитерские изделия\n-завтраки из зерновых\n-мультивитамины\n-зубная паста\n-быстрорастворимые напитки\nДопустимая дневная доза. \nДопустимая дневная доза потребления (ADI) для сахарина была установлена в количестве 5 мг на один килограмм веса тела человека (JECFA)'),(476,'0;b0c25801-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Травяной','aromatizator_harchovii_travyanoi','Артикул не задан','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(477,'0;b0c25781-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Свинина','aromatizator_harchovii_svinina','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(478,'0;7d022ecf-23e7-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Свинина','aromatizator_harchovii_svinina','ТОВ \"Компанія Лев-Украіна\"','Ароматизатор застосовується у виробництві мясопереработке, ковбасних виробах, в корм для домашніх і сільськогосподарських тварин, в корм для рибного лову і т.п.\nДозування підбирається індивідуально для продукту, приблизно 0,8-1,2кг на 1 тонну готового продукту.\nУпаковка каністра 10кг, пляшка пластикова 1кг, флакон 30г, пляшечка 10г і флакон 1г.'),(479,'0;d10eb3b0-9aac-11e4-a570-2e85dff2b333','Підсолоджувач Світлі','pidsolodzhuvach_svitli','ТОВ \"УкрАрома\"','Підсолоджувачі світлі - коефіцієнт солодощі 200, за різним складом, за характеристиками:\nСвітлі SCAA (сахарин, цикламат, аспартам, ацесульфам) - нетермостабільний, так як в його складі присутній аспартам, який при температурі 80С руйнується, він підходить для напоїв і продуктів, що не піддаються термічній обробці;\nСвітлі SC (сахарин, цикламат) -термостабільний;\nСвітлі SCА (сахарин, цикламат, ацесульфам) -термостабільний\n\nКомплексна добавка підсолоджувачів в залежності від маркування, сахарин, цикламат, аспартам, ацесульфам, Застосовується у виробництві напоїв, соусів, фруктових наповнювачах, сиропах в якості часткової або повної заміни цукру. Ми імпортуємо підсолоджувачі і змішуємо їх на спецальном обладнанні. \nСвитли пройшли сертифікацію в Україні на систему управління безпеки харчових продуктів О038.СУБХП.038ф-19'),(480,'0;b0c25785-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Варене згущене молоко','aromatizator_harchovii_varene_zgush_ene_moloko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(481,'0;5038af74-23e8-11e6-8e3f-cab4f2128b62','Ароматизатор харчовий Варене згущене молоко','aromatizator_harchovii_varene_zgush_ene_moloko','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(482,'0;b0c2578d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Варене згущене молоко','aromatizator_harchovii_varene_zgush_ene_moloko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(483,'0;4c488fad-008a-11e6-bcf4-623365396135','Ароматизатор харчовий Варене згущене молоко','aromatizator_harchovii_varene_zgush_ene_moloko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(484,'0;b0c25791-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Згущене молоко','aromatizator_harchovii_zgush_ene_moloko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(485,'0;b0c25795-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Згущене молоко','aromatizator_harchovii_zgush_ene_moloko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(486,'0;a4157797-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Згущене молоко','aromatizator_harchovii_zgush_ene_moloko','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\n*Напитки дозировка 0,05-0,1 % к готовому продукту\n*Каши дозировка 0,07-0,14 % к готовому продукту\nПредельно допустимая дозировка	Не более 14 % к готовому продукту'),(487,'0;12dde512-262d-11e6-ad16-cab4f2128b62','Ароматизатор харчовий Згущене молоко','aromatizator_harchovii_zgush_ene_moloko','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(488,'0;a4157778-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Згущене молоко','aromatizator_harchovii_zgush_ene_moloko','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т.'),(489,'0;f69f4212-1254-11e8-85db-cab4f2128b62','Ароматизатор харчовий Молоко згущене','aromatizator_harchovii_moloko_zgush_ene','ТОВ \"УкрАрома\"','Нет описания'),(490,'0;b0c2579d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Селера','aromatizator_harchovii_selera','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(491,'0;b0c257a1-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Насіння','aromatizator_harchovii_nasinnya','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.\nДозировка в жареную семечку 0,05%\nОбычно ароматизатор Семечка растворяют в растительном масле рафинированном дезодорированном.\nАроматизированное масло наносят на  семечку из расчета  1,0 -1,5%\nДозировка ароматизатора в масло  2,0 -3,0%, в зависимости  от желаемой интенсивности аромата.\nЕсли упаковка герметичная, а не перфорированная, то  аромат сохраняется на протяжении всего срока хранения. Сохранность аромата зависит также от качества  самих семечек. Если процесс прогоркания семечки сильный, то никаким ароматизатором его не спрячешь.\nесли все пересчитать то получается 0,05%'),(492,'0;b0c258a9-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Сидр','aromatizator_harchovii_sidr','ТОВ \"ВМ Про\"','Нет описания'),(493,'0;cad61122-9aac-11e4-a570-2e85dff2b333','Барвник Міхрома синій кармін','barvnik_mihroma_sinii_karmin','Naturex Ltd','Е 120. Концентрація пігментів: 6% кармінової кислоти. Термостабільність, светостойкость- чудова. Застосування:  глазурі, сахарная пудра, молочні продукти, тістечка / печива. Відтінок: ліловий, фіолетовий. Рекомендації з дозування: 0,1-0,75%.\nОдержуваний з кармінової кислоти, виробленої самками комах кошенілі.'),(494,'0;180e6f71-2f71-11e9-b6ba-7e85ef3200af','Барвник Синий патентований','barvnik_sinii_patentovanii','Артикул не задан','Нет описания'),(495,'0;b0c257a9-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Сiтро','aromatizator_harchovii_sitro','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(496,'0;aa17449d-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Лісова ягода (Слива)','aromatizator_harchovii_lisova_yagoda_(sliva)','ТОВ \"ВМ Про\"','Область применения сухих ароматизаторов\n	Сухие ароматизаторы незаменимы в производстве пищевых концентратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработ