 молочных продуктов и др.\nПредельно допустимая дозировка	Не более 2% к готовому продукту'),(515,'0;b0c257d9-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Сметана','aromatizator_harchovii_smetana','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(516,'0;44bcdd22-0dea-11e6-90ca-623365396135','Ароматизатор харчовий Молоко соевое','aromatizator_harchovii_moloko_soevoe','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(517,'0;cad61069-9aac-11e4-a570-2e85dff2b333','Барвник Сонячний захід','barvnik_sonyachnii_zahid','MASCOT FOOD COLOURS','E 110. Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,050-0,100 кг/т'),(518,'0;aa1744e1-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Солод','aromatizator_harchovii_solod','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(519,'0;d10eb3c2-9aac-11e4-a570-2e85dff2b333','Сорбат калію','sorbat_kaliyu','FOODCHEM INTERNATIONAL CORPORATION','мелко гранулированный\nЕ202,консервант, активно угнетающий дрожжи, плесневые грибы, некоторые виды бактерий, а также угнетающий действие ферментов. За счет этого увеличивается срок годности изделий. Сорбат калия не обладает микробицидным действием, он только замедляет развитие микроорганизмов. \nСорбат калия хорошо растворим в воде, в рекомендуемой дозировке не влияет на вкус консервируемых продуктов, выдерживает термообработку. \n Дозировка\nМаксимально допустимая дозировка в пищевых продуктах не более 0,2%.\n•	масло, маргарины — 60-120 г/100 кг продукта;\n•	майонез, горчица, кетчуп и др. — 100-200 г/100 кг продукта;\n•	мясные копчености, копченые колбасы — 200г/100 кг сырья,\n•	консервированные овощи — 100-200 г/100 л рассола;\n•	томатное пюре (12%) — 50-150 г/100 кг продукта;\n•	джемы, варенья, повидло и пр. — 70-200 г/100 кг продукта;\n•	плодово-ягодное пюре — 50-60 г/100 кг продукта,\n•	фруктовые начинки для выпечки — 150-200 г/100 кг продукта;\n•	фруктовые заготовки для йогуртов и других молочных продуктов — 100-150 г/100 кг продукта;\n•	яблочный сок полуфабрикат — 65 г/100 кг продукта;\n•	виноградный сок-полуфабрикат — 65-80 г/100 кг продукта;\n•	концентраты фруктовых соков — 100-200 г/100 кг продукта;\n•	безалкогольные напитки — 40-60 г/100 кг продукта;\n•	газированные безалкогольные напитки — 30-40 г/100 кг продукта; настои трав, чай, кофе — 40-60 г/100 кг продукта;\n•	слабоалкогольные вина — 20-30 г/100 кг продукта;\n•	безалкогольные вина — 50 г/100 кг продукта;\n•	сахарные кондитерские изделия (конфеты, начинки для вафель, нуга, пралине, шоколад) — 150-200 г/100 кг продукта;\n•	мучные кондитерские изделия (бездрожжевые) — 130-200 г/100 кг продукта;\n•	масляный крем — 200 г/100 кг продукта.\nСпособ применения: сорбат калия растворяют в холодной или теплой питьевой воде, после чего этот раствор тщательно смешивают с продуктом или используют для поверхностной обработки. \nОбработка 10-20%-м раствором сорбата калия подавляет рост плесневых грибов на твердых колбасах и сардельках.\nСорбат калия широко используются для консервирования фруктовых и овощных консервов, яичных и кондитерских изделий, мясных и рыбных продуктов, плодово-ягодных соков и безалкогольных напитков, консервировании фруктов и овощей для дальнейшей переработки.\nВ небольших количествах добавляется к содержащим уксус маринадам и пряным соусам, особенно восточноазиатской кухни, чтобы предохранить их от дрожжей и плесневых грибов.'),(520,'0;d10eb3c6-9aac-11e4-a570-2e85dff2b333','Сорбінова кислота','sorbinova_kislota','Hugestone Enterprise Co., LTD','Сорбінова кислота Е200- консервант.\nХарчова добавка Е200 має антимікробні властивості, що не токсична, не канцерогенів. У розумних дозах сорбінова кислота робить позитивний вплив на людський організм, підвищуючи імунітет і сприяючи детоксикації організму. Завдяки цим властивостям добавка Е200 широко застосовується в харчовій промисловості як консервант, дозволяючи збільшити терміни зберігання продуктів харчування.\n\nвластивостями:\n-угнетающее влияние на плесневые грибы, дрожжи, бактерии некоторых видов; \n-отсуствие микробицидного воздействия, что предполагает применение лишь для чистых продуктов; \n-отсуствие воздействия на органолептические свойства пищевых продуктов; \n-замедление развития микроорганизмов, что увеличивает сроки хранения.\nДозировка\nмасло, маргарины — 30—60 г/100 кг продукта;\nсыры — 60—100 г/100 кг продукта;\nрыбопродукты — 100—200 г/100 кг продукта;\nкопченые колбасы — 200—400 г/100 кг фарша;\nварёная колбаса — 50—80 г/100 кг фарша;\nквашеная капуста — 100 г/100 кг продукта;\nджемы, варенья, повидло и пр. — 50—150 г/100 кг продукта;\nплодово-ягодное пюре — 50—60 г/100 кг продукта;\nяблочный сок-полуфабрикат — 50 г/100 кг продукта;\nвиноградный сок-полуфабрикат — 50—60 г/100 кг продукта;\nконфеты, начинки для вафель, нуга, пралине, шоколад — 80—150 г/100 кг продукта;\nмучные кондитерские изделия (бездрожжевые) — 100—200 г/100 кг продукта;\nполуфабрикаты кондитерского производства (тесто) — 200—300 г/100 кг продукта;\nмасляный крем — 200 г/100 кг продукта;\nДопустимое суточное поступление (ФАО/ВОЗ)\nбезусловно допустимая доза — 0—12,5 мг/кг веса тела;\nусловно допустимая доза — 12,5—25 мг/кг веса.\nСорбиновая кислота плохо растворима в воде, хорошо в спирте и эфире'),(521,'0;d10eb3ca-9aac-11e4-a570-2e85dff2b333','Сорбіт','sorbit','FOODCHEM INTERNATIONAL CORPORATION','E420 Сорбитол в основном используется в качестве подсластителя в лекарствах, кондитерских изделиях які хворі на  диабет, жевательных резинках таблетках. Стабилен к кислотам и нагреванию. Это также один из наиболее популярных столовых подсластителей, разрешённых для прямой продажи населению.\nДругие области применения: как диуретическое средство, носитель и влагоудерживающий агент в производстве красок, косметике, фармпрепаратах.\nВ сутки рекомендовано применять до 40 г этого вещества. Коэфф