о теста, снижает энергетические затраты при замесе и выпечке, делает равномерным цвет и структуру вафель и бисквита, уменьшает гигроскопичность вафельного листа, значительно улучшает внешний вид, структуру и цвет вафельного листа, предотвращает образование сколов на краях листа при резке, обеспечивает равномерную пористость бисквита, улучшает пластичность пельменного теста, теста для крекеров (сухого печения), улучшение органолептические показатели песочного теста и изделий, предотвращает растрескивание пельменных заготовок во время формовки и заморозки.\nДозировка, 10-50г/100 кг муки. В зависимоти от толщены листа. Обеспечивает тесту быструю потерю вязкости и хорошее растекание по поверхности вафельницы.'),(557,'0;a4157714-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Квасоля','aromatizator_harchovii_kvasolya','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(558,'0;57aa6938-2dff-11e9-b6ba-7e85ef3200af','Компонент харчовий \"Райс рот\"','komponent_harchovii_rais_rot_','RAPS GmbH & Co KG','Нет описания'),(559,'0;7478bd5e-3484-11e6-a609-cab4f2128b62','Ароматизатор харчовий Фіалка','aromatizator_harchovii_fialka','ТОВ \"ВМ Про\"','Нет описания'),(560,'0;9fe331eb-2671-11e6-ad16-cab4f2128b62','Ароматизатор харчовий Фінік','aromatizator_harchovii_finik','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(561,'0;4f0de836-2648-11e6-ad16-cab4f2128b62','Барвник Фіолетовий суміш','barvnik_fioletovii_sumish','ТОВ \"Компанія Лев-Украіна\"','Використовують для фарбування тесту, мастики, і багатьох харчових продуктів. Для яскравого фарбування білкового крему використовуйте порошкоподібні барвники.'),(562,'0;b0c25865-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Фісташка','aromatizator_harchovii_fistashka','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового про