тракт','barvnik_clear-col_midno-hlorofilinovii_ekstrakt','Naturex Ltd','Е 141. Концентрація пігментів: 10% мідного хлорофіліну. Термостабільність, светостойкость- хороша. Застосування: напої, ароматичні емульсії, джеми і варення, морозиво. Відтінок: зелений. Рекомендації з дозування: 0,05-0,1%.\nФізична реакція молекули хлорофілу в Каскаді фотосинтезу, де електрон входити в ланцюг.'),(572,'0;cad61132-9aac-11e4-a570-2e85dff2b333','Барвник Міднохлорофілліновий екстракт','barvnik_midnohlorofillinovii_ekstrakt','Naturex Ltd','Е 141. Концентрация пигментов: 8% медного хлорофилла. Термостабильность, светостойкость- хорошая. Применение: масло-жировые продукты, кондитерские изделия, мучные изделия, ароматические эмульсии. Оттенок: зеленый. Рекомендации по дозировке: 0,02-0,2%.'),(573,'0;2a334c6b-10b2-11e8-85db-cab4f2128b62','Барвник Мідно-хлорофіловий порошок','barvnik_midno-hlorofilovii_poroshok','Naturex Ltd','Нет описания'),(574,'0;d10eb3ed-9aac-11e4-a570-2e85dff2b333','Цикламат натрію','ciklamat_natriyu','Артикул не задан','Цикламат натрия (E952)-бескалорийный подсластитель. используется в пищевой промышленности в качестве подсластителя. Это химическое вещество в десятки раз слаще сахара\n\nОтносительная сладость: \nв 30 раз слаще сахара.\nСвойства.\nВозможно снижение калорийности пищевых продуктов и напитков за счет замены сахара цикламатом. Стабилен, имеет продолжительные сроки хранения. Может применяться при варке и выпечке. Не вызывает кариеса зубов. Показан людям, страдающим сахарным диабетом. В комбинации с другими подсластителями дает синергический эффект.\nДопустимая дневная доза. \n\nПрименение: \n\n-газированные и негазированные напитки\n-фруктовые и овощные соки\n-пудинги и желе\n-молочные продукты\n-столовые подсластители\n-жевательные резинки\n-джемы, мармелады\n-фармацевтика\n-завтраки из зерновых\n-конфеты, кондитерские изделия\n-фруктовые презервы\n-сухие смеси напитков.\nДопустимая дневная доза потребления (ADI) для цикламата была установлена в количестве 11 мг на кг веса тела (JECFA).'),(575,'0;d10eb381-9aac-11e4-a570-2e85dff2b333','Натрій лимоннокислий 3-х заміщений','natrii_limonnokislii_3-h_zamish_enii','Артикул не задан','Е331(iii) ЦИТРАТ НАТРИЯ 3-ЗАМЕЩЁННЫЙ. Регулятор кислотности, стабилизатор, эмульгатор, эмульгирующая соль, синергист антиоксидантов, фиксатор окраски.\nДозировка:\nВ качестве соли-плавителя в количестве до 30 г/кг плавленого сыра. Цитраты придают плавленому сыру приятный, слегка кисловатый вкус и в меру плотную, достаточно эластичную консистенцию. Понижение значения рН создаёт неблагоприятные условия для жизнедеятельности газообразующих микроорганизмов, в результате чего плавленый сыр с применением цитратов более стоек при хранении.\nВ качестве стабилизатора: рубленых мясных продуктов до 3 г/кг мяса или жира; крови убойных животных до 16 г/л. Для восстановления солевого (ионного) равновесия, необходимого для термоустойчивости молока, подвергаемого нагреванию, к нему добавляют соли-стабилизаторы, в качестве которых могут выступать все цитраты. Они связывают ионы кальция. Соли используются в виде 10-25%-х водных р-ров. Натрий лимоннокислый 3-замещённый наиболее эффективно восстанавливает солевое равновесие. Доза соли-стабилизатора зависит от термоустойчивости конкретной партии молока, поэтому колеблется в пределах 0,05-0,4% от массы нормализуемой смеси.\nЦитрат натрия используется также в качестве регулятора кислотности и ретардатора в мармеладе, джемах, вареньях, желе на пектине, десертах, хлебобулочных, кондитерских изделиях и т.д. до 10 г/кг; синергиста антиоксидантов в соках, маргаринах, растительных маслах, лярде, свином жире до 100 мг/кг. Ускорение растворения сухих смесей (например, для мороженого) достигается добавкой фосфатов или цитратов натрия.'),(576,'0;b0c25811-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Цитрусовий','aromatizator_harchovii_citrusovii','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(577,'0;d7b29f7c-9aac-11e4-a5