центратов:\n•	Первые и вторые обеденные блюда, каши, соусы;\n•	Сладкие блюда – десерты, полуфабрикаты мучных изделий,  (кексы, торты, печенье, коврижки); \n•	Напитки - чай, кофейные напитки, горячий шоколад, прохладительные инстант-напитки; \n•	Снеки; \n•	Спортивное питание\n•	Кисели. Сухие ароматизаторы добавляют непосредственно к смеси сухих рецептурных ингредиентов.\n	Ароматизаторы применяют как для инстант-продуктов, так и для продуктов, требующих термической обработки. \nИх успешно используют также в производстве других видов пищевых продуктов: \nмясных изделий, плавленых сыров, спредов и маргаринов, начинок и наполнителей,  мучных и сахаристых кондитерских изделий, молочных продуктов и др.\nПредельно допустимая дозировка	Не более 10 % к готовому продукту'),(631,'0;a4d0b5bf-666a-11e9-92b8-d85803d2ab2e','Ароматизатор харчовий Енергія','aromatizator_harchovii_energiya','Артикул не задан','Нет описания'),(632,'0;de1167e9-9aac-11e4-a570-2e85dff2b333','Етіл Мальтол','etil_maltol','Anhui Haibei Co., Ltd','Этилмальтол (пищевая добавка E637) – кристаллический порошок белого цвета, обладающий ярко-выраженным карамельным запахом и сладким вкусом, отлично растворимый в воде.Этилмальтол используется в пищевой промышленности в качестве ароматизатора и стабилизатора.Используется для усиления вкуса ароматизаторов. Его вкусовая сила превышает такое же свойство мальтола в 4-6 раз. Ароматизирующее вещество этилмальтола заметно усиливает восприятие некоторых ароматов. Не смотря на то, что чаще всего это вещество используется в сладких продуктах, его также применяют для улучшения аромата многих гастрономических продуктов. Например, этилмальтол часто добавляют в майонез. Это делается для того, чтобы сгладить резкий вкус уксусной кислоты и гармонизировать остроту. Кроме того, обладая низкой калорийностью, он может добавлять ощущение жирности таким продуктам, как майонез, йогурт, мороженое. Вкус этих продуктов гармонизируется, а калорийность заметно снижается. Также это вещество добавляют в порошкообразные смеси, такие как растворимые супы, желе и др.\nРекомендуемая дозировка: 0,1-0,5% (для растворения кристаллов этилмальтола требуется небольшое разогревание растворителя)'),(633,'0;c4e9cd3d-817b-11e6-ac23-cab4f2128b62','Етіл мальтол розчин','etil_maltol_rozchin','Артикул не задан','Этил мальтол 10% растворен в пропиленгликоле. Применяется как жидкость для электронных сигарет.Также ЭМ используется парильщиками для усиления арома слабых ароматизаторов в дозировке 1-5% на массу ароматизатора.'),(634,'0;b0c25885-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Яблуко','aromatizator_harchovii_yabluko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(635,'0;a41577c7-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Яблуко','aromatizator_harchovii_yabluko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(636,'0;b2f894d5-dbb6-11e5-875f-623365396135','Ароматизатор харчовий Яблуко','aromatizator_harchovii_yabluko','ТОВ \"ВМ Про\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(637,'0;d42f7488-2677-11e6-ad16-cab4f2128b62','Ароматизатор харчовий Яблоко','aromatizator_harchovii_yabloko','ТОВ \"Компанія Лев-Украіна\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(638,'0;764edcd8-e081-11e6-8ea9-cab4f2128b62','Ароматизатор харчовий Яблуко','aromatizator_harchovii_yabluko','ТОВ \"УкрАрома\"','Нет описания'),(639,'0;b0c25891-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Яблуко','aromatizator_harchovii_yabluko','ТОВ \"УкрАрома\"','Предельно допустимая дозировка:	0,800 - 1,200 кг на 1т готового продукта.'),(640,'0;be246af9-9aac-11e4-a570-2e85dff2b333','Ароматизатор харчовий Яблуко','aromatizator_harchovii_yabluko','ТОВ \"УкрАрома\"','Підбирається індивідуально для кожної групи виробів за результатами лабораторного тестування, 0,8-1,5 кг/т'),(641,'0;be246afd-9aac-11e4-a